import React from 'react';


const UsersList = ({users, base_url, onClick, onRemoveClick, editDelete}) => (

    <div className="table_container">
        <div className="Header">
            <div className="h_username">Nombre de usuario</div>
            <div className="h_email">Email</div>
        </div>
        {
            users.length>0 ?
            (
                users.map(entry =>
                    <UserDetail editDelete={editDelete} 
                                key={entry.id} 
                                user={user} 
                                base_url={base_url} 
                                onClick={onClick} 
                                onRemoveClick={onRemoveClick}/>
                )
            ) : (
                <div key="no_results" className="no_results"> No se han encontrado resultados </div>
            )
        }
    </div>
);

const UserDetail = ({user, base_url, onClick}) => (
    <div className="entryDetail" key={user.id} data-id={user.id} onClick={onClick}>
        <div className="e_edit"><i className="fas fa-edit"></i></div>
        <div className="e_delete" onClick={() => onRemoveClick(user.id)}><i className="fas fa-trash-alt"></i></div>

        <div className="user_detail_wrapper">
            <div className="em_title">{user.username}</div>
            <div className="em_author">{user.email}</div>
        </div>
    </div>
)

export default UsersList;
